import React from 'react';
import '../css/Preloader.css';
import logo from '../images/mainlogo.gif';

const Preloader = () => {
    return (
        <div className='glow'>
            <p className='glowanim'>WELCOME TO MY PORTFOLIO WEBSITE!</p>
            <img src="https://vault8.io/57725af3d3c44f9992d2edb2c96e.gif/autoorient,resize_fit-1920-1080/Man_Working_at_his_Desk_GIF_Animation_Loop.gif?p=0aa930d138b25b338ee16fe&s=12e8a8cda0a757e148be934dde3e820de938663a" alt="img"/>
        </div>
    )
}

export default Preloader;
